import { ColumnWrapper, IconHolder, IconSubtitle, Img } from './ColumnElements'

export const FooterColumn = ({icon, subtitle,position}) => {
  return (
    <ColumnWrapper position={position}>
<IconHolder>
    </IconHolder> 
<IconSubtitle>{subtitle}</IconSubtitle>   
    </ColumnWrapper>
  )
}
